import React from 'react';
import logo from '../logo.svg';
import './App.css';
import Navbar from './navbar/navbar.js';

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
